svg.script:
    var scaling = 1;
    var verbose = 0;
    var m; // menu
    var um; // unmenu
    var u; // Undermountain.svg
    var p; // parent node of the svg
    var w; // warning text

    function warnUser(t) {
      if (!t) {
        t = 'Click captions to toggle visibility.';
      }
      w.nodeValue = t;
    }
    // helper function to set map locations
    function moveMap(x,y) {
      var newtrans = 'translate(' + x + ',' + y + '), scale(' + 1 / scaling + ')'
      m.setAttributeNS(null, 'transform', newtrans);
      um.setAttributeNS(null, 'transform', newtrans);
    }

    // shift the map so that map location x,y is at the top-left corner of the window
    function newView(x,y) {
      var nx,ny;
      if (verbose) {
        alert("going to "+x+" "+y);
      }
      if (p) {
        p.scrollLeft = x * scaling;
        p.scrollTop = y * scaling;
        nx = p.scrollLeft / scaling;
        ny = p.scrollTop / scaling;
      } else {
        window.scrollTo(x * scaling, y * scaling);
        nx = window.pageXOffset/scaling;
        ny = window.pageYOffset/scaling;
      }
      if (Math.floor(x) != Math.floor(nx) || Math.floor(y) != Math.floor(ny)) {
        warnUser("Can't scroll that far.");
      } else {
        warnUser(null);
      }
      moveMap(nx,ny);
    }

    // window width in map locations
    function getWidth(div) {
      var ret;
      if (p) {
        ret = p.clientWidth;
      } else {
        ret = window.innerWidth;
      }
      return ret / div / scaling;
    }
    function getHeight(div) {
      var ret;
      if (p) {
        ret = p.clientHeight;
      } else {
        ret = window.innerHeight;
      }
      return ret / div / scaling;
    }
    // return the current value from newView()
    function getX() {
      var ret;
      if (p) {
        ret = p.scrollLeft;
      } else {
        ret = window.pageXOffset;
      }
      return ret / scaling;
    }
    function getY() {
      var ret;
      if (p) {
        ret = p.scrollTop;
      } else {
        ret = window.pageYOffset;
      }
      return ret / scaling;
    }
    // return the largest value that can be passed to newView()
    function getMaxX() { 
      var ret;

      if (window.scrollMaxX) {
        ret = window.scrollMaxX;
        if (verbose) {
          alert("getMaxX scrollMaxX "+ret);
        }
      } else {
        var innerw;
        if (p && p.clientWidth) {
          innerw = p.clientWidth;
          if (verbose) {
            alert("getMaxX innerw = p.clientWidth "+innerw);
          }
        } else if (window.innerWidth) {
          innerw = window.innerWidth;
          if (verbose) {
            alert("getMaxX innerw = window.innerWidth "+innerw);
          }
        } else if (u.clientWidth) {
          innerw = u.clientWidth;
          if (verbose) {
            alert("getMaxX innerw = u.clientWidth "+innerw);
          }
        } else {
          alert("unknown max in getMaxX()");
          innerw = 0;
        }
        if (u.scrollWidth > u.offsetWidth) { // all but Explorer Mac 
          ret = u.scrollWidth - innerw; 
          if (verbose) {
            alert("getMaxX u.scrollWidth "+u.scrollWidth + ", ret "+ret);
          }
        } else { 
          // works in Explorer 6 Strict, Mozilla (not FF) and Safari 
          ret = u.offsetWidth - innerw; 
          if (verbose) {
            alert("getMaxX u.offsetWidth "+u.offsetWidth+", ret "+ret);
          }
        } 
      }
      return ret / scaling; 
    }
    function getMaxY() { 
      var ret;

      if (window.scrollMaxY) { // Firefox 
        ret = window.scrollMaxY; 
        if (verbose) {
          alert("getMaxY scrollMaxY "+ret);
        }
      } else {
        var innerh;

        if (p && p.clientHeight) {
          innerh = p.clientHeight;
          if (verbose) {
            alert("getMaxY innerh = p.clientHeight "+innerh);
          }
        } else if (window.innerHeight) {
          innerh = window.innerHeight;
          if (verbose) {
            alert("getMaxY innerh = window.innerHeight "+innerh);
          }
        } else if (u.clientHeight) {
          innerh = u.clientHeight;
          if (verbose) {
            alert("getMaxY innerh = u.clientHeight "+innerh);
          }
        } else {
          alert("Unknown max in getMaxY()");
          innerh = 0;
        }
        if (u.scrollHeight > u.offsetHeight){ // all but Explorer Mac 
          ret = u.scrollHeight - innerh; 
          if (verbose) {
            alert("getMaxY u.scrollHeight "+u.scrollHeight + ", ret "+ret);
          }
        } else { 
          // works in Explorer 6 Strict, Mozilla (not FF) and Safari 
          ret = u.offsetHeight - innerh; 
          if (verbose) {
            alert("getMaxY u.offsetHeight "+u.offsetHeight+", ret "+ret);
          }
        }
      } 
      return ret / scaling; 
    }

    function rEsIzE(evt, by) {
      var x,y;
      x = getX() + getWidth(2);
      y = getY() + getHeight(2);
      scaling *= by;
      // setting [wh].value directly does not seem to work, so do it the hard way.
      u.setAttributeNS(null,'width', u.width.baseVal.value * by);
      u.setAttributeNS(null,'height', u.height.baseVal.value * by);
      newView(x - getWidth(2), y - getHeight(2));
    }
    function sCrOlL(evt, xby, yby) {
      newView(getX() + xby * getWidth(6), getY() + yby * getHeight(6));
    }
    function mOvEtO(evt,xto,yto) {
      newView(xto * getMaxX(), yto * getMaxY());
    }
    function sWaPm(evt) {
      if (m.style.display == 'inline') {
        m.style.display = 'none';
        um.style.display = 'inline';
      } else {
        um.style.display = 'none';
        m.style.display = 'inline';
      }
    }
    function tIcK(evt, x, y) {
      newView(getX() + x, getY() + y);
    }
    function kEy(evt) {
      var c;
      c = evt.charCode;
      if (!c)
        c = evt.keyCode;
      switch (c) {
      case 105: warnUser("at "+getX()+" "+getY()+", max "+getMaxX()+" "+getMaxY()+", screen "+getWidth(1)+" "+getHeight(1)+", scaling "+scaling); break; // i
      case 118: verbose = !verbose; break; // v
      case 39: tIcK(evt,-1,-1); break; // '
      case 44: tIcK(evt,0,-1); break; // ,
      case 46: tIcK(evt,1,-1); break; // .
      case 97: tIcK(evt,-1,0); break; // a
      case 111: tIcK(evt,0,0); break; // o
      case 101: tIcK(evt,1,0); break; // e
      case 59: tIcK(evt,-1,1); break; // ;
      case 113: tIcK(evt,0,1); break; // q
      case 106: tIcK(evt,1,1); break; // j
      case 49: mOvEtO(evt,0,1); break; // 1
      case 50: mOvEtO(evt,0.5,1); break; // 2
      case 51: mOvEtO(evt,1,1); break; // 3
      case 52: mOvEtO(evt,0,0.5); break; // 4
      case 53: mOvEtO(evt,0.5,0.5); break; // 5
      case 54: mOvEtO(evt,1,0.5); break; // 6
      case 55: mOvEtO(evt,0,0); break; // 7
      case 56: mOvEtO(evt,0.5,0); break; // 8
      case 57: mOvEtO(evt,1,0); break; // 9
      case 61: rEsIzE(evt, 1/scaling); break; // =
      case 66: rEsIzE(evt,2); break; // B
      case 98: rEsIzE(evt,1.1); break; // b
      case 77: case 109: sWaPm(evt); break; // m M
      case 83: rEsIzE(evt,0.5); break; // S
      case 115: rEsIzE(evt,0.9); break; // s
      case 76: sCrOlL(evt,-2,0); break; // L
      case 108: sCrOlL(evt,-1,0); break; // l
      case 82: sCrOlL(evt,2,0); break; // R
      case 114: sCrOlL(evt,1,0); break; // r
      case 85: sCrOlL(evt,0,-2); break; // U
      case 117: sCrOlL(evt,0,-1); break; // u
      case 68: sCrOlL(evt,0,2); break; // D
      case 100: sCrOlL(evt,0,1); break; // d
      }
    }
    // Change layers and/or position so that the element named n2 is in the
    // window where the element named n1 was.  If n1 and n2 are on different
    // layers, n1's layer is made invisible, and n2's layer is visible.  Also
    // if turnoff is non-null, that layer is made invisible too.
    function warpTo(n1, n2, turnoff) {
      var tfm = document.getElementById(n1);
      var xfm = tfm.getAttribute('xpos');
      var yfm = tfm.getAttribute('ypos');
      if (!xfm) {
        xfm = tfm.x.baseVal.value + tfm.width.baseVal.value/2;
        yfm = tfm.y.baseVal.value + tfm.height.baseVal.value/2;
      }
      xfm -= getX();
      yfm -= getY();
      var lfm = tfm.parentElement;
      while (lfm.getAttribute('inkscape:groupmode') != 'layer') {
        lfm = lfm.parentElement;
      }

      var tto = document.getElementById(n2);
      var xto = tto.getAttribute('xpos');
      var yto = tto.getAttribute('ypos');
      if (!xto) {
        xto = tto.x.baseVal.value + tto.width.baseVal.value/2;
        yto = tto.y.baseVal.value + tto.height.baseVal.value/2;
      }
      var lto = tto.parentElement;
      while (lto.getAttribute('inkscape:groupmode') != 'layer') {
        lto = lto.parentElement;
      }

      if (lfm != lto) {
        if (lto.style.display == 'none') {
          lto.style.display = 'inline';
          document.getElementById('b-'+lto.id).style.fill = '#000000';
          lfm.style.display = 'none';
          document.getElementById('b-'+lfm.id).style.fill = '#ff0000';
        }
      }
      if (turnoff) {
        document.getElementById(turnoff).style.display = 'none';
        document.getElementById('b-'+turnoff).style.fill = '#ff0000';
      }
      newView(xto - xfm, yto - yfm);
    }
    function moveMenu(evt) {
// from http://www.howtocreate.co.uk/tutorials/javascript/browserwindow
      var x = 0, y = 0;
      if (p) {
        x = p.scrollLeft;
        y = p.scrollTop;
      } else if( typeof( window.pageYOffset ) == 'number' ) {
        // Firefox on RHEL-6    alert('a');
        x = window.pageXOffset;
        y = window.pageYOffset;
      } else if( document.body && ( document.body.scrollLeft || document.body.scrollTop ) ) {
        // alert('b');
        x = document.body.scrollLeft;
        y = document.body.scrollTop;
      } else if( document.documentElement && ( document.documentElement.scrollLeft || document.documentElement.scrollTop ) ) {
        // alert('c');
        x = document.documentElement.scrollLeft;
        y = document.documentElement.scrollTop;
      } else {
        // alert('d');
        warnUser('Unknown browser type');
      }
      x /= scaling;
      y /= scaling;
      moveMap(x,y);
    }
    function sTaRt() {
      document.documentElement.addEventListener('keypress',kEy,false);
      m = document.getElementById('menu');
      um = document.getElementById('unmenu');
      w = document.getElementById('errortext').firstChild;
      u = document.getElementById('Undermountain');
      p = u.parentElement;
      if (p) {
        p.onscroll = moveMenu;
      } else {
        window.onscroll = moveMenu;
      }
      moveMap(0,0);
    }
    function toggleLayer(e, n) {
      var l = document.getElementById(n).style;
      if (l.display == 'inline') {
        l.display = 'none';
        e.target.style.fill = '#ff0000';
      } else {
        l.display = 'inline';
        e.target.style.fill = '#000000';
      }
    }
    function stairs(n1, n2) {
      document.getElementById(n1).style.display = 'none';
      document.getElementById('b-'+n1).style.fill = '#ff0000';
      document.getElementById(n2).style.display = 'inline';
      document.getElementById('b-'+n2).style.fill = '#000000';
    }
